import React, { useEffect } from "react";

const AdminHome = (userData) => {
  useEffect(() => {
    fetch("http://localhost:5050/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data, "userData");
      });
  }, []);
  const logout = () => {
    window.localStorage.clear();
    window.location.href = "./";
  };
  return (
    <div>
      <div className="bg-zinc-400 h-screen flex justify-center items-center">
        <div className="bg-white rounded-lg shadow-black/30 border-solid border-2 border-black h-96 pl-10 space-y-3 w-[350px] flex flex-col justify-center">
          <div className="bg-white-400 border-solid border-2 border-black rounded-lg mr-10 mb-20 w-auto">
            <h1>Welcome Admin</h1>
            <table>
              <tr className="w-500">
                <th>Name: </th>
                <th>Email: </th>
                <th>User Type: </th>
                <th>Delete: </th>
              </tr>
            </table>
            <br />
          </div>

          <button
            onClick={logout}
            className="flex justify-center items-center bg-slate-900 w-20 h-7 text-white rounded-full mb-2 ml-2"
          >
            Log Out
          </button>
        </div>
      </div>
    </div>
  );
};

export default AdminHome;
